Crédito ao consumo:
O crédito ao consumo ou  crédito aos consumidores é um contrato de crédito celebrado com particulares, sem fins comerciais ou profissionais. Tem como finalidade financiar a aquisição de bens de consumo, designadamente computadores, viagens, automóveis, educação ou saúde. Os créditos ao consumo são: Empréstimos a particulares de montante entre os 200 e os 75 000 euros;
As ultrapassagens de crédito, mesmo que de montante inferior a 200 euros;
Os empréstimos destinados à realização de obras em imóveis, sem garantia hipotecária ou outro direito sobre coisa imóvel, mesmo que de montante superior a 75 000 euros. Existem diversas modalidades de crédito aos consumidores com diferentes custos, comissões e outros encargos associados.
